import React from "react";
import "../../Styles/Shared/SolutionsMenu.scss";

function SolutionsMenu() {
  return (
    <div className='solutionsMenu'>
      <div className='solutionsMenuHeader'>
        <h4>MONETIZE</h4>
        <h4>MANAGE</h4>
        <h4>OPTIMIZE</h4>
        <h4>B2B Commerce</h4>
      </div>
    </div>
  );
}

export default SolutionsMenu;
